import React from 'react';
import './App.css';
import axios from 'axios';

function App() {


  getmygithub = () => {

    axios.get('https://api.github.com/users/trickascp/repos')
    .then((res) => {
      console.log(res)
    })

  }



  return (
    <div className="App">
      Hi
    </div>
  );
}

export default App;
